-- Table structure for image
-- ----------------------------
DROP TABLE IF EXISTS `image`;
CREATE TABLE `image`  (
  `imageId` int(11) NOT NULL AUTO_INCREMENT COMMENT '图片id',
  `mallId` int(11) DEFAULT NULL COMMENT '所属商品ID',
  `isFirst` int(11) DEFAULT NULL COMMENT '是否是主图（1表示是，2表示否）',
  `imageBase` mediumblob COMMENT '图片的base码',
  `imageNum` int(11) DEFAULT NULL COMMENT '图片编号',
  `createTime` timestamp(0) DEFAULT NULL COMMENT '上传时间',
  `updateTime` timestamp(0) DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`imageId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

