-- ----------------------------
-- Table structure for mall
-- ----------------------------
DROP TABLE IF EXISTS `mall`;
CREATE TABLE `mall`  (
  `mallId` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `mallNum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商品编号',
  `mallDes` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商品描述',
  `currentPrice` int(11) DEFAULT NULL COMMENT '售价',
  `costPrice` int(10) DEFAULT NULL COMMENT '成本',
  `mallType` int(11) DEFAULT NULL COMMENT '样式类型(具体类型后期定)',
  `mallColor` int(11) DEFAULT NULL COMMENT '颜色',
  `mallBrand` int(11) DEFAULT NULL COMMENT '品牌',
  `createTime` timestamp(0) DEFAULT NULL COMMENT '上架日期',
  `updateTime` timestamp(0) DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改日期',
  `isRecommend` int(11) DEFAULT NULL COMMENT '是否推荐',
  `parentPrice` int(10) DEFAULT NULL COMMENT '原价',
  `discount` double(255, 0) DEFAULT NULL COMMENT '折扣',
  PRIMARY KEY (`mallId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 24 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

