-- Table structure for mallcart
-- ----------------------------
DROP TABLE IF EXISTS `mallcart`;
CREATE TABLE `mallcart`  (
  `cartId` int(11) NOT NULL AUTO_INCREMENT,
  `mallId` int(11) DEFAULT NULL,
  `userId` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'openId',
  `status` int(11) DEFAULT NULL COMMENT '状态(1：未结算 2：已结算 3：已删除)',
  `mallCount` int(11) DEFAULT NULL COMMENT '数量',
  `totalPrice` int(11) DEFAULT NULL COMMENT '当前总价',
