  `updateTime` datetime(0) DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`cartId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for order
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order`  (
  `orderId` int(11) NOT NULL,
  `userId` int(11) DEFAULT NULL,
  `openId` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `status` int(11) NOT NULL COMMENT '1:(已付款，待确认)2:(已确认)3:(已发货)4:(申请取消)5:(待确认取消)6:(已取消)7:(已收货)8:(已完成)',
  `totalPrice` int(11) DEFAULT NULL COMMENT '当前订单总价',
  `addressId` int(11) DEFAULT NULL COMMENT '发往地址',
  `createTime` datetime(0) DEFAULT NULL,
  `updateTime` datetime(0) DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`orderId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

